#https://data.vision.ee.ethz.ch/cvl/rrothe/imdb-wiki/# load file with meta data#load("wiki.mat")ticn = length(wiki.dob); # # rowsdisp(n);# columns that will be stored in csv; no name since it makes troublecolNames = {"full_path","dob","face_location","face_score","gender","photo_taken","second_face_score"} ;sep = ",";# add column for agestr = "";for col=colNames  str = [str,col{1},sep];end;str = [str,"age",sep];disp(str); # open file and write column names fileID = fopen('wiki_meta.csv','w');fprintf(fileID,[str(1:length(str)-1),"\n"]);# write data rowsfor line=1:n   str = "";   for fn=colNames      value = wiki.(fn{1})(line);      #disp(value);      if iscell(value)          value = value{1};      end      if isnumeric(value)          value = num2str(value);      end      # disp(value)      str = [str,value,sep];   end   # add age   [age,~]=datevec(datenum(wiki.photo_taken(line),7,1)-wiki.dob(line));   str = [str,num2str(age),sep];      #disp(str)   fprintf(fileID,[str(1:length(str)-1),"\n"]);endfclose(fileID);toc